import logo from './logo.svg';
import './App.css';

function App() {
  const testData = 
    {
      "id":1,
      "english":"Hello!",
      "chinese":"你好！",
      "pinyin":"nǐhǎo!"
    }
  ;
  return (
    <div className="App">
      <header className="App-header">Learn Chinese!</header>
      <div className="LessonContent">
        <table>
          <th></th>
        </table>
        <p className="English">{testData.english}</p>
        <p className="Pinyin">{testData.pinyin}</p>
        <p className="Chinese">{testData.chinese}</p>
      </div>
    </div>
  );
}

export default App;
